import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.e[0].title}
        amount={props.e[0].amount}
        date={props.e[0].date}
      />
      <ExpenseItem
        title={props.e[1].title}
        amount={props.e[1].amount}
        date={props.e[1].date}
      />
      <ExpenseItem
        title={props.e[2].title}
        amount={props.e[2].amount}
        date={props.e[2].date}
      />
      <ExpenseItem
        title={props.e[3].title}
        amount={props.e[3].amount}
        date={props.e[3].date}
      />
    </div>
  );
}

export default Expense;
